					["Scourge"] = true,
				},
				["end"] = {
					["NPC:63196"] = true,
				},
				["reward_text"] = "Aha! Show me that.\r\n\r\nHmm... we will send this to the monastery for analysis. As we find which of these symbols are most common in their writing, we can begin to understand the meaning of these writings.",
				["classes"] = {
					["WARRIOR"] = true,
