			[31377] = {
				["reward_text"] = "You've arrived just in time, <class>.",
				["end"] = {
					["NPC:57324"] = true,
				},
			},
			[56259] = {
				["reward_text"] = "The blood of our enemies has been shed. I shall mix this blood with the rest that has been gathered. Once the offering is complete, the Ice Lord shall show these Stormpike dogs the full wrath of the Frostwolf Clan!",
				["progress_text"] = "Have you come with an offering?",
				["end"] = {
					["NPC:13236"] = true,
				},
			},
			[27050] = {
				["reward_text"] = "You are proficient at stepping on things. You would make an excellent giant.",
				["end"] = {
					["NPC:43804"] = true,
				},
			},
			[37660] = {
				["reward_text"] = "I wouldn't take what Arev'naal said to heart. The inquisitor demons are masters of misinformation. You don't suspect betrayal within the ranks, do you?\r\n\r\n<The Souleater looks thoughtful and grim.>\r\n\r\nI fear we won't have all of our answers about Lord Illidan for a while.",
				["end"] = {
					["NPC:89398"] = true,
				},
			},
			[41230] = {
				["reward_text"] = "These devices are peculiar. They are like the traps our hunters use, but can magically attract and trap nearby beasts.",
				["progress_text"] = "Do you have the snares, dwarf?",
				["end"] = {
					["NPC:100775"] = true,
				},
			},
			[44561] = {
				["reward_text"] = "In the changing of seasons, the truth will be revealed.",
				["progress_text"] = "The arcan'dor needs time.",
				["end"] = {
					["NPC:107126"] = true,
				},
			},
			[40744] = {
				["reward_text"] = "That should be plenty. Talondust loses its potency fairly quickly, so we must make haste.",
				["progress_text"] = "Do you have what I require, dwarf? We don't have much time to spare.",
				["end"] = {
					["NPC:99093"] = true,
				},
			},
			[48912] = {
				["reward_text"] = "A lightforged soldier can wade through a sea of demons. They will serve you well.",
				["progress_text"] = "The campaign against the Legion has taxed our existing resources heavily. Bring me supplies and I will place a lightforged under your command.\r\n\r\nI can only spare a lightforged for this few resources once per week.",
				["end"] = {
					["NPC:124312"] = true,
				},
			},
			[41469] = {
				["reward_text"] = "Welcome back. I see we are ready to begin.",
				["end"] = {
					["NPC:103569"] = true,
				},
			},
			[41740] = {
				["reward_text"] = "Excellent choice, Farseer. Shaman from all over the world have much to learn from one another.",
				["end"] = {
					["NPC:96746"] = true,
				},
			},
			[29122] = {
				["reward_text"] = "Hooray! It just goes to show you, when a turtle puts his mind to something -\n\n<Mylune is distracted by a butterfly and never finishes her thought.>",
				["end"] = {
					["NPC:52671"] = true,
				},
			},
			[37469] = {
				["reward_text"] = "<You notice the reflection of something sinister upon the core's surface...>",
				["progress_text"] = "<The last remaining piece of the Tidestone lies before you.>",
				["end"] = {
					["OBJECT:240552"] = true,
				},
			},
			[40266] = {
				["begin"] = {
					["NPC:99065"] = true,
				},
				["progress_text"] = "<Thaedris seems lost in thought as he gazes towards the city of Suramar.>",
				["races"] = {
					["DarkIronDwarf"] = true,
				},
				["end"] = {
					["NPC:99093"] = true,
				},
				["reward_text"] = "<Thaedris stirs from his thoughts as you approach.>\n\nThese will be sufficient, dwarf.\n\n Cliffthorn is a deadly poison, and will be perfect for my needs.",
				["classes"] = {
					["SHAMAN"] = true,
				},
			},
			[48976] = {
				["reward_text"] = "Battlelord, thanks to your efforts, our forces have been able to secure additional resources from the battlefield.\r\n\r\nThe more you continue to dominate the battlefield the more resources our forces can spare.",
				["end"] = {
					["NPC:127151"] = true,
				},
			},
			[29138] = {
				["reward_text"] = "I saw several of our <class>s make it back to safety shortly after you departed. It seems your efforts were quite effective. Thank you.",
				["end"] = {
					["NPC:53080"] = true,
				},
			},
			[36481] = {
				["reward_text"] = "Wow, great flying out there, ace! Here's your prize!",
				["end"] = {
					["NPC:85546"] = true,
				},
			},
			[47254] = {
				["reward_text"] = "Let us use this moment to reflect upon the past, lest we forget the lessons it teaches us, and doom ourselves to repeat it once more.",
				["end"] = {
					["NPC:110035"] = true,
				},
			},
			[29297] = {
				["reward_text"] = "Those blasted burds are dead? Good riddance!",
				["end"] = {
					["NPC:53214"] = true,
				},
			},
			[42370] = {
				["reward_text"] = "And... it looks like we're out of time for today's wand practice. Go on, then. Off to your next class!",
				["end"] = {
					["NPC:89661"] = true,
				},
			},
			[13846] = {
				["reward_text"] = "Thank you. I just know the crusade will put it to good use!",
				["progress_text"] = "Do you want to contribute?",
				["end"] = {
					["NPC:34210"] = true,
				},
			},
			[13810] = {
				["reward_text"] = "You are a true champion, <name>, both inside the ring and on the field. We must all be vigilant against the <race> and you are a great example to our brethren and your own people.",
				["end"] = {
					["NPC:33763"] = true,
				},
			},
			[14105] = {
				["reward_text"] = "You are truly an example to all who have gathered beneath our banner, <name>. Together, we will show the <race> that we will not be defeated.",
				["end"] = {
					["NPC:34882"] = true,
				},
			},
			[14107] = {
				["reward_text"] = "You have done our fallen brethren a great service and spared us the need to face them again on the field of battle. As our campaign against the <race> progresses, I find myself thinking about my own fate.\n\nShould I fall, <name>, I would want someone like you to do for me what you have done for the spirits of the fallen this day. I could not bear the thought of forcing my own brothers to slay me again and again.",
				["end"] = {
					["NPC:35094"] = true,
				},
			},
			[30959] = {
				["reward_text"] = "Good, you're back in one piece.\n\nWe hope to be seeing more of you in the future, undead.",
				["end"] = {
					["NPC:61581"] = true,
				},
			},
			[29433] = {
				["reward_text"] = "Did you seek out worthy challenges, or did you simply find some field of boars and slaughter them?\n\nThere is a reason I am the strongest.\n\nPerhaps, one day you will see just how strong I really am, <class>.  Until then, keep pushing yourself.  But don't forget to take a break from time to time.\n\nLike now.  Here, enjoy the Darkmoon Faire.",
				["progress_text"] = "No pain, no gain.",
				["end"] = {
					["NPC:14832"] = true,
				},
			},
			[37565] = {
				["reward_text"] = "Now the captives are free. Thank you, <name>.\r\n\r\nReady for the prince?",
				["end"] = {
					["NPC:89051"] = true,
				},
			},
			[30716] = {
				["reward_text"] = "Chi-Ji smiles on you.",
				["end"] = {
					["NPC:60528"] = true,
				},
			},
			[13862] = {
				["reward_text"] = "The Argent Crusade is heartened to have <class>s like you fighting alongside us in the battle against the Lich King.",
				["end"] = {
					["NPC:33759"] = true,
				},
			},
			[27154] = {
				["reward_text"] = "I suppose that we can take his aggression as an admission of guilt.  You alright, <name>?",
				["end"] = {
					["PLAYER:0"] = true,
				},
			},
			[0] = {
				["progress_text"] = "",
			},
			[28692] = {
				["reward_text"] = "These parts will really help us out, <name>!  Who would have thought you can find stuff this useful in all that old junk?",
				["progress_text"] = "Did that magnet contraption actually work?",
				["end"] = {
					["NPC:48363"] = true,
				},
			},
			[40227] = {
				["reward_text"] = "Honeyed words from a stranger. While comforting, they do not shake my resolve. Come, at this rate I will wither before we are through.",
				["end"] = {
					["NPC:99093"] = true,
				},
			},
			[29210] = {
				["reward_text"] = "Well done!\n\nThey've been attempting to start rituals of this sort all over the Molten Front, but we've been able to thwart them every time so far. Hopefully you will be present in the future to help us keep up that trend.",
				["end"] = {
					["NPC:52823"] = true,
				},
			},
			[41215] = {
				["reward_text"] = "Excellent work. They do not respect the hunt, so they must be reminded of their place.",
				["end"] = {
					["NPC:106897"] = true,
				},
			},
			[37653] = {
				["reward_text"] = "Yes. Already, I can tell their souls are weaker than their flesh.",
				["end"] = {
					["NPC:89398"] = true,
				},
			},
			[41741] = {
				["reward_text"] = "The scouting mission was more successful than we could have imagined, <name>. Your troops were able to rescue Journeyman Goldmine, a... most unusual little <class>.\n\nIn thanks, he has agreed to lend his skill to our cause.",
				["end"] = {
					["NPC:96746"] = true,
				},
			},
			[41494] = {
				["reward_text"] = "Your assistance made this all possible. Thank you.",
				["progress_text"] = "You witness history, dwarf.",
				["end"] = {
					["NPC:103568"] = true,
				},
			},
			[48642] = {
				["reward_text"] = "The Argussian Reach thank you.",
				["end"] = {
					["NPC:127151"] = true,
				},
			},
			[36920] = {
				["reward_text"] = "A friend it would seem.\r\n\r\nKayn did not think we could handle this? He might have been right this time.",
				["end"] = {
					["NPC:90255"] = true,
				},
			},
			[56308] = {
				["reward_text"] = "You have saved our camp, and quite possibly our people.\r\n\r\nThank you, <name>.",
				["end"] = {
					["NPC:159544"] = true,
				},
			},
			[14143] = {
				["reward_text"] = "These look a little worse for wear, but they're still edible. The crusaders will be glad to hear that we've had some success. Maybe we can give the half-eaten ones to the Silver Covenant. That would make my day.",
				["progress_text"] = "Were you able to recover any of the missing supplies?",
				["end"] = {
					["NPC:34771"] = true,
				},
			},
			[14145] = {
				["reward_text"] = "I'm glad we've gotten that done. It's not the most glorious task in the world, but when we partnered with the Argent Crusade, we promised to do all they asked of us without complaint. Of course, the same cannot be said of the Silver Covenant.",
				["progress_text"] = "I hope you have something to feed Icehowl, otherwise I really will start bringing Silver Covenant members down to his cage.",
				["end"] = {
					["NPC:34914"] = true,
				},
			},
			[41032] = {
				["reward_text"] = "Yes! I can feel their spells receding. Soon I will be able to rejoin Thalrenus!",
				["end"] = {
					["NPC:101768"] = true,
				},
			},
			[31039] = {
				["begin"] = {
					["NPC:62304"] = true,
				},
				["races"] = {
					["Scourge"] = true,
				},
				["end"] = {
