				},
				["reward_text"] = "The Shan'ze are up to something. Well done, <name>, but we must continue to monitor their actions.",
				["classes"] = {
					["WARRIOR"] = true,
				},
			},
			[31043] = {
				["reward_text"] = "Well done, <name>.\n\nWe'll begin deciphering the writing on these tablets at once.",
				["progress_text"] = "Knowledge is powerful. That is why the mogu are so dangerous.",
				["end"] = {
					["NPC:62378"] = true,
					["NPC:62304"] = true,
				},
			},
			[31047] = {
				["reward_text"] = "Good work, undead. It gladdens me to see that the wild serpents are free once again.",
				["end"] = {
					["NPC:62378"] = true,
					["NPC:62304"] = true,
				},
			},
			[42371] = {
				["reward_text"] = "My hand is beginning to tire from taking so many notes. I think it's time we took a break.",
				["progress_text"] = "I agree. Research can be grueling work.",
				["end"] = {
					["NPC:107334"] = true,
				},
			},
			[42226] = {
				["reward_text"] = "Do you have any idea what you have done?!",
				["end"] = {
					["NPC:107126"] = true,
				},
			},
			[37510] = {
				["reward_text"] = "Hello, what can I do for you, little dwarf?\r\n\r\nAhahaha... it's you!  I like how you came in and immediately confronted Whalebelly. That little tuskarr's got it coming.\r\n\r\nI can tell you're going to win big for me in the arena.",
				["end"] = {
					["VEHICLE:88923"] = true,
				},
			},
			[37518] = {
				["reward_text"] = "Yes, the headmistress is in her study, but I can't have you bothering her right now. Classes are about to start.",
				["end"] = {
					["NPC:89661"] = true,
				},
			},
			[55121] = {
				["reward_text"] = "<The magic of the system appears to have been drained. Perhaps after some time has passed it can be used again.>",
				["end"] = {
					["OBJECT:322533"] = true,
				},
			},
			[30067] = {
				["reward_text"] = "You have saved us. From what fate, I dare not imagine.",
				["end"] = {
					["NPC:57324"] = true,
				},
			},
			[37542] = {
				["reward_text"] = "You made quick work of that monkey. Now there's an empty position on Sternfathom's team that you can fill.\r\n\r\nBut first, let's get me set up for what comes after your big match.",
				["end"] = {
					["NPC:88873"] = true,
				},
			},
			[37492] = {
				["reward_text"] = "I can't tell you how relieved I am that Elder Aldryth has returned.\n\nHonestly, life here in the palace hasn't been the same without him. Everything seemed to have... lost its color. Perhaps now we can get back to our normal lives.",
				["end"] = {
					["NPC:88798"] = true,
				},
			},
			[30063] = {
				["reward_text"] = "I suspect these masks allow the sha to make a physical connection to our world.\n\nI must study them further if we are to banish these creatures forever.\n\nThank you, <name>. Your aid is greatly appreciated.",
				["progress_text"] = "Please handle the masks carefully. If you are not careful, they will attempt to consume you.",
				["end"] = {
					["NPC:57319"] = true,
				},
			},
			[37566] = {
				["reward_text"] = "With Oceanus dead, the skrogs will start fighting amongst themselves. They'll certainly be too busy to provide any further assistance to the naga.\r\n\r\nI'd say this was a job well done, despite my being captured. Good thing you came along.\r\n\r\nI'll see you around, <name>.",
				["end"] = {
					["NPC:109334"] = true,
				},
			},
			[27011] = {
				["begin"] = {
					["NPC:44472"] = true,
				},
				["progress_text"] = "Some of the older lumberjacks tell me that the Redpine lived in the area several years ago, but left when the plague arrived.  That doesn't make it OK for them to steal, though.",
				["races"] = {
					["Vulpera"] = true,
				},
				["end"] = {
					["NPC:44472"] = true,
				},
				["reward_text"] = "I'll just put this back over in the lumber stores outside.  Nathaniel probably won't even notice it was missing.",
				["classes"] = {
					["PRIEST"] = true,
				},
			},
			[38857] = {
				["reward_text"] = "Excellent, my good sir. I cannot thank you enough for the freedom of my people. Rosh is especially appreciative.\r\n\r\n<Gentle Rosh grunts.>\r\n\r\nPerhaps you and I can do some more business together.",
				["end"] = {
					["NPC:91419"] = true,
				},
			},
			[42228] = {
				["reward_text"] = "<Energy pulses around the ancient seed.>",
				["end"] = {
					["NPC:108101"] = true,
				},
			},
			[46268] = {
				["reward_text"] = "<As the king examines the compass, his expression turns from recognition to sorrow.>\n\nWhen I went through my father's things and didn't find this compass, I assumed it was with him on the Broken Shore when Gul'dan...\n\n<The king's voice breaks.>",
				["progress_text"] = "Well met, <name>. What brings you to Stormwind this day?",
				["end"] = {
					["NPC:107574"] = true,
				},
			},
			[29257] = {
				["reward_text"] = "Thank you, <name>. I will start analyzing these samples at once.",
				["progress_text"] = "Fascinating! The more time I spend in the Firelands, the more I see there is an ecosystem at work here.",
				["end"] = {
					["NPC:52489"] = true,
				},
			},
			[37468] = {
