			[52930] = {
				["reward_text"] = "Ain't nothin' more valuable than sweet, sweet gold.",
				["progress_text"] = "A <class> like you's surely gotta have a little extra cash in your stash.\n\nWaddaya say? Lemme help lighten your load a bit?",
				["end"] = {
					["NPC:142157"] = true,
				},
			},
			[56508] = {
