				["progress_text"] = "Grab what things you can!",
				["end"] = {
					["NPC:152747"] = true,
				},
			},
			[27047] = {
				["reward_text"] = "Well done, undead. These will do well.",
				["progress_text"] = "Painite is one of the most valuable materials to us, particularly due to our inability to reach most of the deposits on our own.",
				["end"] = {
					["NPC:43805"] = true,
				},
			},
			[27051] = {
				["reward_text"] = "Thank you, undead. We will weed the rest out of their possession in time.",
				["progress_text"] = "Have you done as I've asked of you? We must weed out whatever growth agent remains within their possession.",
