				["reward_text"] = "Ha! Good work. Teaches both of them to make enemies of the Shado-Pan.",
				["classes"] = {
					["WARRIOR"] = true,
				},
			},
			[47050] = {
				["reward_text"] = "Yes, outsider? What business do you have here?",
				["end"] = {
					["NPC:116568"] = true,
				},
			},
			[56493] = {
				["reward_text"] = "You've sent them a message they won't forget.",
				["end"] = {
					["NPC:155188"] = true,
				},
			},
			[29211] = {
				["reward_text"] = "It is destroyed? Good. I doubt this will deter Fandral for long, but we must gain every advantage we can muster.",
				["end"] = {
					["NPC:52494"] = true,
				},
			},
			[29123] = {
				["reward_text"] = "Well-fought, <name>. Take a break from the flames for a while.\n\nHyjal will live to see another day, and when that day comes, I will need you alive.",
				["end"] = {
					["NPC:52669"] = true,
				},
			},
			[41480] = {
				["begin"] = {
					["NPC:103571"] = true,
				},
				["races"] = {
					["DarkIronDwarf"] = true,
				},
				["end"] = {
					["NPC:103571"] = true,
				},
				["reward_text"] = "Such a gluttonous creature.",
				["classes"] = {
					["SHAMAN"] = true,
				},
			},
			[38834] = {
				["reward_text"] = "The two of you are a welcome sight. We pushed the demons out of these ruins, but they are stronger than any we have encountered before.\r\n\r\nYour help is appreciated. If we do not crush this Legion invasion now, they will overrun Azsuna and then the rest of the Broken Isles.",
				["end"] = {
					["NPC:89362"] = true,
				},
			},
			[41312] = {
				["reward_text"] = "Hail, miner. I can take this leystone off of your hands. Your gift will be put to good use.",
				["progress_text"] = "Have you come to assist the Dreamweavers?",
				["end"] = {
					["NPC:106901"] = true,
				},
			},
			[29139] = {
				["reward_text"] = "We will win this battle. Whatever it takes, we will not let these elementals back into Hyjal.",
				["end"] = {
					["NPC:52467"] = true,
				},
			},
			[29143] = {
				["reward_text"] = "Well done, <class>. I'll have to make more use of your skills in the future.",
				["end"] = {
					["NPC:52467"] = true,
				},
			},
			[37256] = {
				["reward_text"] = "<Idri stares at the ugly head.>\n\nYes, that's him.",
				["progress_text"] = "<The nightwatcher looks at you expectantly.>",
				["end"] = {
					["NPC:89023"] = true,
				},
			},
			[40324] = {
				["reward_text"] = "Good. Let us see what we can learn.",
				["end"] = {
					["NPC:97140"] = true,
				},
			},
			[28390] = {
				["reward_text"] = "Perhaps one day, we shall slay these stone troggs more swiftly than they can breed, and in so doing, end the line of fungalmancers forever.\n\nIn time.",
				["end"] = {
					["NPC:44973"] = true,
				},
			},
			[29159] = {
				["reward_text"] = "Wonderful! The more spiders we clear out, the easier it will be to push forward.",
				["end"] = {
					["NPC:52921"] = true,
				},
			},
			[37727] = {
				["reward_text"] = "Capital! A prodigious start.\n\nI implore you to create this marvelous mixture for yourself. I want to share the delight of alchemical spirits with the world!\n\nYou'll need to get more eggs for yourself, though.",
				["progress_text"] = "Are we speaking again because you have my eggs?",
				["end"] = {
					["NPC:89341"] = true,
				},
			},
			[30952] = {
				["reward_text"] = "You fight like you are one of us.",
				["end"] = {
					["NPC:61580"] = true,
				},
			},
			[30956] = {
				["reward_text"] = "Look at him, <class>.\n\nNothing can stop Niuzao. Only Niuzao can stop Niuzao.",
				["end"] = {
					["NPC:61580"] = true,
				},
			},
			[46747] = {
				["reward_text"] = "Hero! \r\n\r\nYour dedication to defending Val'sharah has given us a much needed respite from the vile influence of the Legion. We were able to scavenge some supplies as a result of your efforts. \r\n\r\nHere, take them and know that, should you continue to aid us, we will set aside more rewards such as these as we find them.",
				["end"] = {
					["NPC:106901"] = true,
				},
			},
			[29179] = {
				["reward_text"] = "Your continued efforts are appreciated, <class>. We will win this war as long as people like you stand beside us.",
				["end"] = {
					["NPC:52824"] = true,
				},
			},
			[29438] = {
				["reward_text"] = "I knew you could do it, <class>!  Here's your prize.  Enjoy the faire.",
				["end"] = {
					["NPC:14841"] = true,
				},
			},
			[30717] = {
				["reward_text"] = "Thank you, <name>.\n\nReturn to us again soon.",
				["progress_text"] = "Even the smallest, flimsiest feather is proof enough that Chi-Ji loves us.",
				["end"] = {
					["NPC:60529"] = true,
				},
			},
			[27151] = {
				["reward_text"] = "I must admit, <name>... I have been using my mind vision spell to keep tabs on you.  And I must say... the number of gnolls you found on the trail is truly staggering!",
				["progress_text"] = "Welcome back.",
				["end"] = {
					["PLAYER:0"] = true,
				},
			},
			[27155] = {
				["reward_text"] = "I'm already aware of your actions, <name>.  I welcome you into my town, give you my blessing, and what do you do?\n\nYou slay the traitor that we've been hunting down for weeks.  Well done.  Your heroism is budding much earlier than even I had anticipated.",
				["end"] = {
					["NPC:44441"] = true,
				},
			},
			[28689] = {
				["begin"] = {
					["NPC:48363"] = true,
				},
				["races"] = {
					["Scourge"] = true,
				},
				["end"] = {
					["NPC:48363"] = true,
				},
				["reward_text"] = "May their souls rest in peace.",
				["classes"] = {
					["WARRIOR"] = true,
				},
			},
			[54453] = {
				["reward_text"] = "Champion of Azeroth, I appreciate all the help you've given us.\r\n\r\nPlease take these supplies as a token of my  gratitude, and a promise of more to come, should you continue to help.",
				["end"] = {
					["NPC:130216"] = true,
				},
			},
			[54461] = {
				["reward_text"] = "Thanks for all the help around Vol'dun, <class>.\r\n\r\nPlease take these supplies as a token of our gratitude, and a promise of more to come, should you continue to help.",
				["end"] = {
					["NPC:135804"] = true,
				},
			},
			[41464] = {
				["reward_text"] = "I am relieved, though there remains more we must do.",
				["end"] = {
					["NPC:106696"] = true,
				},
			},
			[29263] = {
				["reward_text"] = "Ah knew Ricket's bombs'd come in handy. Twas just a matter ah findin' somethin' big enough to explode.",
				["end"] = {
					["NPC:53214"] = true,
				},
			},
			[37910] = {
				["reward_text"] = "Good job, and nice time!",
				["end"] = {
					["PLAYER:0"] = true,
				},
			},
			[41197] = {
				["reward_text"] = "They look so happy to be home. Excellent work.",
				["end"] = {
					["NPC:103570"] = true,
				},
			},
			[48636] = {
				["reward_text"] = "Another lightforged to fight alongside your forces.",
				["progress_text"] = "War is costly work. Have you gathered additional supplies for our efforts here?",
				["end"] = {
					["NPC:124312"] = true,
				},
			},
			[56621] = {
				["reward_text"] = "Glorious recovery!\r\n\r\nAnd you say that the Spark-7143 did NOT cause an extreme burning sensation in your gut?\r\n\r\n<Flip makes a quick note and smiles.>\r\n\r\nWondrous indeed!",
				["progress_text"] = "Please thoroughly document any adverse side effects you experience while using the Spark-7143.",
				["end"] = {
					["NPC:150630"] = true,
				},
			},
			[29275] = {
				["reward_text"] = "Anren, look what <name> found! This is exactly what we needed!\n\nIt will take us some time to look through these supplies. For now, you have our thanks.",
				["progress_text"] = "Trust me - whatever information we can gather here will go far to helping us understand the source of Fandral's powers.",
				["end"] = {
					["NPC:52477"] = true,
				},
			},
			[27153] = {
				["reward_text"] = "Did you notice, <name>?  Many names were mentioned, but one name was mentioned far more than the others.\n\nBisp.",
				["end"] = {
					["PLAYER:0"] = true,
				},
			},
			[29243] = {
				["reward_text"] = "Very well done, <name>! This should delay them significantly.\n\nIf we keep this up, we can easily push the fight back to Ragnaros himself.",
				["end"] = {
					["NPC:52493"] = true,
				},
			},
			[29299] = {
				["reward_text"] = "Did it work? So my theory was correct?",
				["end"] = {
					["NPC:52489"] = true,
				},
			},
			[42234] = {
				["reward_text"] = "The valarjar thank you.",
				["end"] = {
					["NPC:106904"] = true,
				},
			},
			[31040] = {
				["begin"] = {
					["NPC:62304"] = true,
				},
				["races"] = {
					["Scourge"] = true,
				},
				["end"] = {
					["NPC:62378"] = true,
				},
				["reward_text"] = "Good work, <class>. Left unchecked, the sprites would soon outnumber our entire army.",
				["classes"] = {
					["WARRIOR"] = true,
				},
			},
			[31044] = {
				["reward_text"] = "These claws will come in handy.\n\nGood work, <class>.",
				["progress_text"] = "The quilen are fierce, but I see fierceness in your eyes as well.",
				["end"] = {
					["NPC:62304"] = true,
				},
			},
			[31048] = {
				["reward_text"] = "Good riddance, I say! Those mogu ghosts were long past their expiration.",
				["end"] = {
					["NPC:62304"] = true,
				},
			},
			[44636] = {
				["begin"] = {
					["NPC:97140"] = true,
				},
				["races"] = {
					["DarkIronDwarf"] = true,
				},
				["end"] = {
					["PLAYER:0"] = true,
				},
				["reward_text"] = "The withered have been assembled and are ready for their training.",
				["classes"] = {
					["SHAMAN"] = true,
				},
			},
			[48799] = {
				["classes"] = {
					["WARRIOR"] = true,
				},
				["races"] = {
					["Scourge"] = true,
				},
				["begin"] = {
					["NPC:124312"] = true,
				},
			},
			[37257] = {
				["reward_text"] = "Our bones are all we have left of an existence we left behind a long time ago.\n\n<The prince stares intently into your eyes.>\n\nStay with me, <class>. I will help you find your Tidestone.",
				["progress_text"] = "My people may not care much for me, but that will not stop me from caring for them.",
				["end"] = {
					["NPC:88115"] = true,
				},
			},
			[40325] = {
				["reward_text"] = "The withered... Not only do they suffer a burning thirst for the Nightwell, but their own memories torture them as well.\n\nTruly a fate worse than death...",
				["end"] = {
					["NPC:97140"] = true,
				},
			},
			[37528] = {
				["reward_text"] = "I couldn't have snuck past him better. Now, to get these weapons into the right hands.",
				["progress_text"] = "As soon as I can, I'll arm the gladiators in Oceanus Cove.",
				["end"] = {
					["NPC:88873"] = true,
				},
			},
			[37536] = {
				["reward_text"] = "Yes, this'll do nicely... oh no! The last of my pit fighters have been defeated.\r\n\r\nIt's just you and me now, little dwarf.",
				["end"] = {
					["VEHICLE:89048"] = true,
				},
			},
			[28678] = {
				["begin"] = {
					["NPC:48360"] = true,
				},
				["races"] = {
					["Scourge"] = true,
				},
				["end"] = {
					["NPC:48360"] = true,
				},
				["reward_text"] = "You did it!  Maybe we can finally get some ships into port now.  Thank you <name>.",
				["classes"] = {
					["WARRIOR"] = true,
				},
			},
			[46743] = {
				["reward_text"] = "Champion, your help to our people has far exceeded any of our expectations, and has provided us some much needed breathing space.\r\n\r\nPlease, take these supplies to aid you in the war against the Legion. With your continued aid, we should be able to gather more and prepare them for you.",
				["end"] = {
					["NPC:106902"] = true,
				},
			},
			[30064] = {
				["reward_text"] = "Thank you! What a relief it is to see these texts are safe.",
				["progress_text"] = "How are the sutras? Are they damaged?",
				["end"] = {
					["NPC:57319"] = true,
				},
			},
			[41138] = {
				["reward_text"] = "I will call upon you again, I am sure.",
				["end"] = {
					["NPC:103155"] = true,
				},
			},
			[27012] = {
				["reward_text"] = "Thank you, <name>.  I'll be throwing these in the fire.  We don't want those gnolls just sneaking in and stealing them back.",
				["progress_text"] = "I don't want to order some sort of mass gnoll genocide because of a mother's worries.  I'd just like to feel safe in my own home.",
				["end"] = {
					["NPC:44472"] = true,
				},
			},
			[31383] = {
				["reward_text"] = "Well met, <class>! We need your help.",
				["end"] = {
					["NPC:61580"] = true,
				},
			},
			[42692] = {
				["reward_text"] = "This Prince Farondis opposed Queen Azshara, so she got mad and blew everything up? That's awesome!\n\nHey Olothil, listen to this!",
				["end"] = {
					["NPC:89326"] = true,
				},
			},
			[27048] = {
				["reward_text"] = "Well played!\n\nI've got this pretty sweet deal going. A bunch of shmucks go up there to Therazane's Throne and give all kinds of gold to D'lom for who-knows-what kinda crap. He forks all that cash over to me for these crystals. I go home freakin' rich for a couple chunks of rock.\n\nDon't tell no one though. I don't want no competition springin' up.\n\nThink you can come back later to help me get another load of crystals out?",
				["progress_text"] = "Boom?",
				["end"] = {
					["NPC:44968"] = true,
				},
			},
			[30718] = {
				["reward_text"] = "With every battle - a win or a loss - you improve. You become faster, hardier, cleverer... better.",
				["end"] = {
					["NPC:60506"] = true,
				},
			},
			[13811] = {
				["reward_text"] = "Well done. Training against the other champions is one of the best ways to prepare yourself for tournament competition. I know you'll make the Horde proud, <name>.",
				["progress_text"] = "Have you finished training with the other champions?",
				["end"] = {
					["NPC:33771"] = true,
				},
			},
			[31116] = {
				["reward_text"] = "Good, you have helped right this terrible wrong.",
				["end"] = {
					["NPC:63197"] = true,
				},
			},
			[31120] = {
				["reward_text"] = "With Cheng Bo subdued, we can refocus our efforts on our other enemies. Your efforts earn you much respect, <name>.",
				["end"] = {
					["NPC:63009"] = true,
				},
			},
			[13809] = {
				["reward_text"] = "<name>, you and your allies have spared the tournament from a devastating attack. Though our skytalon riders are brave, they  have their hands full keeping the peace on the tournament grounds and would be hard-pressed to defend the skies against the cult's attack. You have the thanks of the Argent Crusade and all who have gathered here to compete.",
				["end"] = {
					["NPC:33759"] = true,
				},
			},
			[41473] = {
				["reward_text"] = "This fine gentleman was just telling me how dearly he loves his forest. Let us assist him!",
				["end"] = {
					["NPC:103569"] = true,
				},
			},
			[37911] = {
				["reward_text"] = "Good job, and nice time!",
				["end"] = {
					["PLAYER:0"] = true,
				},
			},
			[6801] = {
				["reward_text"] = "The blood of our enemies has been shed. I shall mix this blood with the rest that has been gathered. Once the offering is complete, the Ice Lord shall show these Stormpike dogs the full wrath of the Frostwolf Clan!",
				["progress_text"] = "I come from Thunder Bluff, undead. Cairne himself has seen to it that I assist the Frostwolf Clan in these dire times.\n\nBut let us not waste any more time. You must strike down our enemies and bring to me their blood. Once enough blood has been gathered, the ritual of summoning may begin.\n\nVictory will be assured when the elemental lord is loosed upon the Stormpike army.",
				["end"] = {
					["NPC:13236"] = true,
				},
			},
			[28682] = {
				["begin"] = {
					["NPC:48358"] = true,
				},
				["races"] = {
					["Scourge"] = true,
				},
				["end"] = {
					["NPC:48358"] = true,
				},
				["reward_text"] = "You killed him?  We have been trying to take that guy out for weeks!  We thank you, <name>.",
				["classes"] = {
					["WARRIOR"] = true,
				},
			},
			[29128] = {
				["reward_text"] = "A job well done, soldier. While our mission in the Firelands is critical, we must not forget about the well-being of Hyjal.\n\nSpeak with my brother again tomorrow, and he will have another squad prepared for you.",
				["end"] = {
					["NPC:52824"] = true,
				},
			},
			[14092] = {
				["reward_text"] = "I'll let the crusaders know that you've just returned with a fresh load of food while the Silver Covenant was sitting on its heels.",
				["progress_text"] = "Were you able to get those eggs? The jormungar are going to get nasty if they don't get fed.",
				["end"] = {
					["NPC:34914"] = true,
				},
			},
			[37991] = {
				["reward_text"] = "Hail, <class>. We could use your aid.",
				["end"] = {
					["NPC:90543"] = true,
				},
			},
			[37449] = {
				["reward_text"] = "Grim news indeed. We cannot afford the loss of even one demon hunter, but you and Kor'vas were right to put an end to Nightglaive.\r\n\r\nMore importantly, you have made a good friend in Stellagosa. The remnant of the Blue Dragonflight could prove to be a powerful ally.",
				["end"] = {
					["NPC:89362"] = true,
				},
			},
			[42693] = {
				["reward_text"] = "Perfect. Let's get this ritual started, shall we?",
				["progress_text"] = "I would have brought my own spell foci if SOMEONE hadn't been rushing me...",
				["end"] = {
					["NPC:108328"] = true,
				},
			},
			[56471] = {
				["reward_text"] = "This certainly hurts their profits. Now we see if they leave!",
				["end"] = {
					["NPC:155187"] = true,
				},
			},
			[37728] = {
				["reward_text"] = "I was going to present this to one of the ladies of the court. Doing so might increase my standing in certain social circles.\r\n\r\nBut, I just can't bring myself to do it. Who better to drink my latest masterpiece than, well... me?",
				["progress_text"] = "Yes? You have the eyes?",
				["end"] = {
					["NPC:89341"] = true,
				},
			},
			[37736] = {
				["reward_text"] = "Your hat and robes don't match, but you still look better. I hardly recognize you.",
				["progress_text"] = "Still trying to get into the academy, I see.",
				["end"] = {
					["NPC:89660"] = true,
				},
			},
			[28686] = {
				["reward_text"] = "Told you that village was full of wackos.  Nice job clearing it out <name>.",
				["end"] = {
					["NPC:48358"] = true,
				},
			},
			[37497] = {
				["reward_text"] = "Perhaps this was a mistake.",
				["end"] = {
					["NPC:88867"] = true,
				},
			},
			[30734] = {
				["reward_text"] = "There remains only one trainee ranked higher than you.\n\nI have a feeling that you will be facing him when you return.",
				["end"] = {
					["NPC:60506"] = true,
				},
			},
			[51483] = {
				["reward_text"] = "The Dark Irons never had it easy in this world. But with champions like ye tae fight for 'em, our allies know the courage that burns in our hearts.\r\n\r\nEnough fancy banter! Take this armor, then let's toast yer courage with a mug o' cold brew!",
				["end"] = {
					["NPC:144152"] = true,
				},
			},
			[31041] = {
				["reward_text"] = "Gently, gently!\n\nThank you for recovering these eggs safely, <name>.\n\nI know a few Serpent Riders in the Jade Forest who will take good care of these.",
				["progress_text"] = "Did you find any eggs? The serpents lay their eggs in nests on the beach, but the wood sprites are also known to steal them whenever they can.",
				["end"] = {
					["NPC:62378"] = true,
				},
			},
			[28391] = {
				["reward_text"] = "You are quite skilled at bending the dragon's will, undead. I would be jealous of your agility, except that it comes with such a fragile frame.",
				["progress_text"] = "And so continues the cycle of the stone drakes. Tumultuous wills in stoic frames.",
				["end"] = {
					["VEHICLE:42466"] = true,
				},
			},
			[29160] = {
				["reward_text"] = "Wonderful work, <class>. Let's hope those little spider bites aren't infectious.",
				["progress_text"] = "It appears the Cinderweb Spinners are the caretakers of Beth'tilac's brood.",
				["end"] = {
					["NPC:52921"] = true,
				},
			},
			[14104] = {
				["reward_text"] = "Ornolf's crew will want to avenge their leader, but without him, they will be easier to defeat. We must live to carry out our mission, to see Icecrown rid of the <race> and other evils.",
				["end"] = {
					["NPC:34882"] = true,
				},
			},
			[30953] = {
				["reward_text"] = "In times like these, we must trust in the power and protection of Niuzao. Should things get any worse, he will protect us.\n\nHe always does.",
				["end"] = {
					["NPC:61585"] = true,
				},
			},
			[14108] = {
				["reward_text"] = "Crusader, you may have bought those sailors just enough time to escape,  Maybe next time, those Silver Covenant and Sunreavers will listen before running head first at the enemy.",
				["progress_text"] = "Have you driven away the Kraken yet?  Hurry, Crusader! There isn't much time.",
				["end"] = {
					["NPC:35094"] = true,
				},
			},
			[31216] = {
				["reward_text"] = "Well done, Wakener. You have a destroyer's aim.",
				["end"] = {
					["NPC:62151"] = true,
				},
			},
			[40965] = {
				["reward_text"] = "A lesson we all must one day learn. Never assume your enemy dead until you see their corpse. <Lothrius grins.>",
				["progress_text"] = "How fares the education?",
				["end"] = {
					["NPC:101768"] = true,
				},
			},
			[57317] = {
				["reward_text"] = "These will do nicely.  I'll melt them down and patch them up and you'll never know they came from those Stormpike cowards!\n\nThanks, <name>.  And let me polish up that armor of yours...",
				["progress_text"] = "How goes the hunting, <name>.  Do you have any armor scraps for me?",
				["end"] = {
					["NPC:13176"] = true,
				},
			},
			[40908] = {
				["reward_text"] = "<Throndyr mutters through shallow breaths.>\n\nPoison... runs through... my body.",
				["end"] = {
					["NPC:99559"] = true,
				},
			},
			[27152] = {
				["reward_text"] = "Gnolls and necromancy... what a surprise!  And I thought that, here in the Western Plaguelands, we had put these dark days behind us.\n\n<You sense Daria's eyes focusing on something on the ground.>\n\nWait... what is THAT?",
				["end"] = {
					["PLAYER:0"] = true,
				},
			},
			[27156] = {
				["reward_text"] = "I'm just looking over my paperwork here, and it says that we were expecting a FEMALE <race> <class>.  You're not, umm...\n\n<Lieutenant Myner looks at you awkwardly.>\n\nNever mind.  It would appear that you are not the person that I originally hired, but you did a good job.  So I'm going to pay you anyhow.",
				["end"] = {
					["NPC:45157"] = true,
				},
			},
			[29455] = {
				["reward_text"] = "I knew you could do it!\n\nWe'll take any extra rings you might have, and give you your prize ticket.\n\nHave fun!",
				["end"] = {
					["NPC:54485"] = true,
				},
			},
			[53435] = {
				["reward_text"] = "For de Horde!",
				["end"] = {
					["NPC:123000"] = true,
				},
			},
			[29463] = {
				["reward_text"] = "So you have managed to defeat the gnolls.  It felt good, didn't it?\n\nHere is your prize.  Enjoy the rest of the Darkmoon Faire!",
				["end"] = {
					["NPC:54601"] = true,
				},
			},
			[37538] = {
				["reward_text"] = "<This is where you expected to find Okuna. Instead, you only found the pack with the weapons.>",
				["end"] = {
					["OBJECT:239120"] = true,
				},
			},
			[40964] = {
				["begin"] = {
					["NPC:102425"] = true,
