				["races"] = {
					["DarkIronDwarf"] = true,
				},
				["end"] = {
					["NPC:101768"] = true,
				},
				["reward_text"] = "Serena sent you? Good... she still lives.",
				["classes"] = {
					["SHAMAN"] = true,
				},
			},
			[41467] = {
				["reward_text"] = "What a disturbing tale!",
				["end"] = {
					["NPC:103568"] = true,
				},
			},
			[57300] = {
				["reward_text"] = "The battles for Alterac were bloody affairs, I'm glad they're done. \r\nOh wait, the battles are still ongoing! My mistake, I forgot when I was again.",
				["end"] = {
					["NPC:157113"] = true,
				},
			},
			[14136] = {
				["reward_text"] = "Great job, Champion.  The fight continues, but now the Kvaldir know that we do not tolerate such attacks.",
				["end"] = {
					["NPC:34771"] = true,
				},
			},
			[42271] = {
				["reward_text"] = "Of course they would attack now.\n\nThose withered devils couldn't have chosen a more effective time to strike. My brood already suffers.",
				["progress_text"] = "Oh no...",
				["end"] = {
					["NPC:89975"] = true,
				},
			},
			[14140] = {
				["reward_text"] = "Your actions have shown that we Sunreavers are far better allies to the Argent Crusade than the Silver Covenant and it is we who will be triumphant.",
				["end"] = {
					["NPC:34771"] = true,
				},
			},
			[14142] = {
				["begin"] = {
					["NPC:34771"] = true,
				},
				["races"] = {
					["Scourge"] = true,
				},
				["end"] = {
					["NPC:34771"] = true,
				},
				["reward_text"] = "Kul will live to embarrass himself again. That's far from the first time someone's had to save Kul from himself. With examples like him, it's no wonder most of the aspirants are taking up the habits of the Silver Covenant.",
				["classes"] = {
					["WARRIOR"] = true,
				},
			},
			[37450] = {
				["reward_text"] = "Beautiful creatures... pure, one with the world. I didn't think that I could hate the Legion more.\r\n\r\nThank you, <name>.",
				["progress_text"] = "If there's a remnant of the Blue Dragonflight nearby, we should do whatever we can to ally ourselves with them.",
				["end"] = {
					["NPC:90474"] = true,
				},
			},
			[41028] = {
				["reward_text"] = "I must admit I am impressed. You may actually be of some use to us.",
				["end"] = {
					["NPC:102600"] = true,
				},
			},
			[26957] = {
				["reward_text"] = "It would appear that I arrived before you, <name>.\n\nField Agent Kaartish gave me the details about my old home.  It seems my battles with the Scourge aren't quite over yet.",
				["end"] = {
					["NPC:44458"] = true,
				},
			},
			[37729] = {
				["reward_text"] = "Exemplary work, young <name>. With runes like these, you'll be graduating in no time.",
				["end"] = {
					["NPC:89661"] = true,
				},
			},
			[31045] = {
				["reward_text"] = "I knew you could do this, <name>!\n\nWith fewer Shan'ze Illusionists to stand against us, our task here will be much easier.",
				["end"] = {
					["NPC:62304"] = true,
				},
			},
			[31049] = {
				["reward_text"] = "Good work, <name>.\n\nThe wood sprites may look harmless, but that's what makes them so dangerous.",
				["end"] = {
					["NPC:62304"] = true,
				},
			},
			[55348] = {
				["reward_text"] = "The Resistance stands strong, thanks in part to your prevailing efforts.\r\n\r\nYour efficiency has earned you additional resources.\r\n\r\nPlease expend them in endeavors optimized to ensure the continued success of the resistance.",
				["end"] = {
					["NPC:149816"] = true,
				},
			},
			[37658] = {
				["reward_text"] = "Thank you, <name>. That will give us the breathing room we need to launch our counter-offensive.",
				["end"] = {
					["NPC:90317"] = true,
				},
			},
			[31061] = {
				["reward_text"] = "We do not fully understand what the Shan'ze are doing, or the nature of their domination over the wild serpents.\n\nBan's theory is that the only thing that can cut through the mind control is physical pain.\n\nOnce the Shan'ze Cloudrunners feel enough pain, it looses the corruption's hold, and they finally remember who they are.",
				["end"] = {
					["NPC:62304"] = true,
				},
			},
			[41475] = {
				["reward_text"] = "In the end, they will all thrive- for with more Sablehorn, the wolves will eat better in the years to come.",
				["end"] = {
					["NPC:103569"] = true,
				},
			},
			[37530] = {
				["reward_text"] = "What happened, Farondis?",
				["end"] = {
					["NPC:89090"] = true,
				},
			},
			[41108] = {
				["reward_text"] = "Though more Nightborne still pour in through their portals, they will not soon forget the burn of the Moon Guard's wrath.",
				["end"] = {
					["PLAYER:0"] = true,
				},
			},
			[38407] = {
				["reward_text"] = "You say you found this message in a bottle? How quaint.\r\n\r\nYes, I can point you in the right direction, but are you sure you want to take on the sea giant prince and his skrogs? Just to free a bunch of unwashed sailors?",
				["end"] = {
					["NPC:88798"] = true,
				},
			},
			[42224] = {
				["reward_text"] = "<You recognize the relic from Thalyssra's vision.>",
				["end"] = {
					["OBJECT:250383"] = true,
				},
			},
			[30065] = {
				["begin"] = {
					["NPC:57324"] = true,
