				["reward_text"] = "These arrows are still in good shape. They will fly straight and true.\n\nGreat work, <name>.",
				["classes"] = {
					["WARRIOR"] = true,
				},
			},
			[29304] = {
				["reward_text"] = "Good, <class>. The enemy may be tough, but you have proven today that you are tougher.",
				["end"] = {
					["NPC:52824"] = true,
				},
			},
			[27013] = {
				["reward_text"] = "I feel a bit more relieved, <name>.  Thank you.",
				["end"] = {
					["NPC:44472"] = true,
				},
			},
			[27017] = {
				["reward_text"] = "This... Gloria used to read from this prayer book every night!  How had I forgotten?  She was so devout, <name>.\n\n<Del's eyes turn to the finger painting.>\n\nOh...\n\nThis painting... my daughter, Andrea... she loved to... to paint...",
				["progress_text"] = "I wouldn't expect you to indulge the whims of a nostalgic old man, <name>.  Still, if you find yourself in the area...",
				["end"] = {
					["NPC:44458"] = true,
				},
			},
			[42694] = {
				["reward_text"] = "After over ten thousand years... to see mother and father again...\n\n<The elven mage is at a loss for words.>\n\nThank you, <name>. Thank you.",
				["end"] = {
					["NPC:108328"] = true,
				},
