					["NPC:106182"] = true,
				},
			},
			[56257] = {
				["progress_text"] = "We will not suffer the dwarves in our home!  Fall upon our foes and defeat their leader, general Stormpike!",
			},
			[41220] = {
				["reward_text"] = "As I suspected, the Illidari are holding the line against the Burning Legion, but just barely.\r\n\r\nWe must come to their aid, <name>.",
				["end"] = {
					["NPC:93337"] = true,
				},
			},
			[27053] = {
				["reward_text"] = "Cauldron Lord Soulwrath's key disintegrates as it touches the lock on the access panel at the base of the cauldron's platform.  A slight clanking noise is heard within, and the access panel swings open to reveal more viscous toxins within the cauldron's framework.\n\nThere is a small spigot that the bottle fits well enough under, allowing you to draw a sample for Field Agent Kaartish back at the Menders' Stead.",
				["progress_text"] = "An access panel to the cauldron remains securely fastened.  In order to open it, you will need to find the key.",
				["end"] = {
					["OBJECT:176392"] = true,
				},
			},
			[27057] = {
				["reward_text"] = "Good work.  One moment please...\n\n<The draenei takes a moment to compare your sample with a sample he presumably had distilled earlier.>\n\nYes, this appears to be the same corruption that is affecting the wildlife.  With this knowledge, and with your combat expertise, we may have the power to stop this.",
				["progress_text"] = "Gahrron's Withering houses a viciously potent plague cauldron.  Once we have a sample of the plague it spews forth, we will be able to determine whether the Cult of the Damned is truly responsible for continuing to poison the land.",
				["end"] = {
					["NPC:44454"] = true,
				},
			},
			[29101] = {
				["reward_text"] = "<Mylune's voice echoes in your head, along with an unwanted image of playful kittens.>\n\nYou saved the wee turtles, <name>! I hope you gently, lovingly kicked them as hard as you possibly could.",
				["end"] = {
					["PLAYER:0"] = true,
				},
			},
			[56042] = {
				["reward_text"] = "OUTPUT: Please accept this GIFT. \r\n\r\nADMINISTER GIFT DISTRIBUTION PROTOCOL.",
				["end"] = {
					["NPC:153897"] = true,
				},
