				["reward_text"] = "I didn't think you would be able to do it, <name>.  You are just full of surprises aren't you?",
				["classes"] = {
					["WARRIOR"] = true,
				},
			},
			[37467] = {
				["reward_text"] = "<The prince appears emotionally drained.>\n\nThis is the end of the road for me, <name>. I can't bear to look at them. Moreover, my mere presence puts you in danger.\n\nBeyond this point, you must walk alone.",
				["end"] = {
					["NPC:88890"] = true,
				},
