				["progress_text"] = "Were you able to meet with the headmistress?",
				["end"] = {
					["NPC:89660"] = true,
				},
			},
			[52383] = {
				["reward_text"] = "Thank you for assisting us, <class>. We needed these fish badly.",
				["progress_text"] = "Are you here to deliver supplies?",
				["end"] = {
					["NPC:131287"] = true,
				},
			},
			[30957] = {
