				["reward_text"] = "The elementals shall grow to fear you.",
				["end"] = {
					["NPC:52824"] = true,
				},
			},
			[37507] = {
				["reward_text"] = "That could have gone better. Sounds like you've already made an enemy.\r\n\r\nStill, that'll work to our advantage. You versus Boss Whalebelly. The fight of the century... or at least, the day.\r\n\r\nNow to set everything up.",
				["end"] = {
					["NPC:88873"] = true,
				},
