				["races"] = {
					["DarkIronDwarf"] = true,
				},
				["begin"] = {
					["NPC:102334"] = true,
				},
			},
			[38443] = {
				["reward_text"] = "He is... he's dying! Senegos is possibly the oldest dragon alive. We cannot simply let him slip away.\r\n\r\nThere is something not quite right with the magic energy here, I can feel it.",
				["end"] = {
					["NPC:93354"] = true,
				},
			},
			[37656] = {
				["begin"] = {
					["NPC:90474"] = true,
				},
				["races"] = {
					["DarkIronDwarf"] = true,
				},
				["end"] = {
					["NPC:90474"] = true,
				},
				["reward_text"] = "I've always had my doubts about Cyana. Something was never quite right there. Looks like she cracked and joined the Legion.\r\n\r\nStill, we are not going to let her, or this Cordana Felsong, get away with it.",
				["classes"] = {
					["SHAMAN"] = true,
				},
			},
			[40963] = {
				["reward_text"] = "I heard screams, and I was gratified that they belonged to the Nightborne. Well done.",
				["end"] = {
					["NPC:102425"] = true,
				},
			},
			[42230] = {
				["reward_text"] = "<The seed sits perfectly atop the stand and sinks in with a satisfying click.>",
				["end"] = {
					["OBJECT:265435"] = true,
				},
			},
			[30954] = {
				["reward_text"] = "I will see to it that these are properly distributed. What's more - I'll make sure our blacksmiths get a rest. Niuzao knows they deserve it.",
				["progress_text"] = "Our men are accustomed to fighting with maces and clubs. Unfortunatly, we have little time for customs.",
