				},
			},
			[27002] = {
				["reward_text"] = "<name>.  It is truly a pleasure.\n\nI know you are young, and still training, but I've had my eye on you.  We among the Argent Crusade are always looking for promising new recruits, and you have indeed shown great promise.  I have no immediate tasks for you, but merely wished to meet you in person, and see for myself what type of <race> you really were.\n\nFor the time being, the amenities of Hearthglen are yours to enjoy.  I look forward to our next meeting, <name>.  You are dismissed.",
				["end"] = {
					["NPC:44441"] = true,
				},
			},
			[30066] = {
				["reward_text"] = "The sha's numbers are unending, and our numbers few. But we are not daunted by difficult odds.\n\nThank you for doing your part to protect our home, undead.",
